import './App.css'
import React, { Component } from 'react'
import Customer from './components/Customer'

const customers = [
  {
    name: '홍길동',
    birthday: '901111',
    gender: '남자',
    job: '대학생',
    image: 'https://placeimg.com/195/195/1',
  },
  {
    name: '홍두깨',
    birthday: '781111',
    gender: '남자',
    job: '개발자',
    image: 'https://placeimg.com/195/195/2',
  },
  {
    name: '김철수',
    birthday: '581111',
    gender: '남자',
    job: '기술자',
    image: 'https://placeimg.com/195/195/3',
  },
]

class App extends Component {
  render() {
    return (
      <div className="App">
        {customers.map((c) => {
          return (
            <Customer
              name={customers[c].name}
              birthday={customers[c].birthday}
              gender={customers[c].gender}
              job={customers[c].job}
              image={customers[c].image}
            />
          )
        })}
      </div>
    )
  }
}

export default App
